const {
  title,
  message,
  dismissLabel,
  supersonic,
} = inputs;

await supersonic.api.alert.show({
  title,
  message,
  buttonTitle: dismissLabel,
});

const { variable, supersonic, contextId } = inputs;
const { reference, value } = variable;
await supersonic.context.setPageVariable(reference, value, contextId);

const {
  time,
  unit,
} = msg;

const unitCoefficientMap = {
  ms: 1,
  s: 1000,
  min: 1000 * 60,
  h: 1000 * 60 * 60,
};

if (time <= 0) {
  return msg;
}

const timeToWait = time * unitCoefficientMap[unit];

if (supersonic.api.delay) {
  supersonic.api.delay(() => { node.send(msg); }, timeToWait, msg.contextId);
} else {
  setTimeout(() => {
    node.send(msg);
  }, timeToWait);
}

const {
  title,
  message,
  confirmLabel,
  cancelLabel,
  supersonic,
} = inputs;

try {
  const res = await supersonic.api.confirm.show({
    title,
    message,
    buttonTitles: {
      cancel: cancelLabel,
      ok: confirmLabel,
    },
  });
  if (res.clickedIndex === 0) {
    return [1, { confirmed: false }];
  }
  return [0, { confirmed: true }];
} catch (error) {
  return [1, {
    error: {
      code: 'unknown',
      message: 'Unknown error occurred',
      rawError: error,
    },
  }];
}

const {
  page,
  params,
  openInModal,
  supersonic,
  contextId,
} = inputs;
const options = {
  route: page,
  params: params || {},
};
const action = openInModal ? 'pushToModal' : 'pushToStack';
await supersonic.api.navigation[action](options, contextId);

const {
  key,
  supersonic,
} = inputs;
try {
  return await supersonic.api.asyncStorage.removeItem({
    key,
  });
} catch (error) {
  return [1, {
    error: {
      code: 'unknown',
      message: 'Error when trying to delete the given item from storage.',
      rawError: error,
    },
  }];
}

const {
  fileTypes,
  pickMultiple,
  supersonic,
} = inputs;
try {
  const bFileTypes = fileTypes.map((type) => supersonic.api.media.filePicker.types(type));
  let res = await supersonic.api.media.filePicker.pick({
    type: bFileTypes,
    pickMultiple,
  });
  if (res.didCancel) {
    return [1];
  }
  if (!Array.isArray(res)) {
    res = [res];
  }
  return [0, { files: res }];
} catch (error) {
  return [2, {
    error: {
      code: 'unknown',
      message: 'Unknown error occurred while picking files.',
      rawError: error,
    },
  }];
}

const { request, contextId, supersonic } = inputs;
const { resourceName, id, parameters = {} } = request;

const { getComponentContextProp } = supersonic.context;
const { getResourceConfig } = supersonic.api.data;
const { prepareExecutable } = supersonic.api.formulas || {};

const get = (p, o) => {
  const isNumber = (v) => typeof v === 'number';
  const isBoolean = (v) => typeof v === 'boolean';
  const isNull = (v) => v === null;
  const isString = (v) => typeof v === 'string';
  return p.reduce((xs, x) => (
    xs && (xs[x] || isNumber(xs[x]) || isBoolean(xs[x]) || isNull(xs[x]) || isString(xs[x])) ? xs[x] : undefined
  ), o);
};

const importRecord = (record, mappingFields = []) => {
  const importedData = {};
  mappingFields.forEach((field) => {
    if (field && field.mappingExpression && prepareExecutable) {
      try {
        const expression = prepareExecutable(JSON.parse(field.mappingExpression));
        importedData[field.propertyName] = expression.execute({ source: { record } });
      } catch (error) {
        throw new Error('An error occured while executing mapping formula.');
      }
    } else if (field && field.mapping && Array.isArray(field.mapping)) {
      const value = get(field.mapping, record);
      if (value !== undefined) {
        importedData[field.propertyName] = value;
      }
    }
  });
  return importedData;
};

const adapterPrefix = 'adapter';
const [prefix, boundResource] = (resourceName || '').split(':');
const isAdapter = prefix === adapterPrefix;

const getActualResourceName = () => {
  if (isAdapter) {
    const adapterProp = getComponentContextProp(contextId.rootContextId, boundResource, contextId, true);
    return (
      get(['mapping', 'value'], adapterProp) || get(['value'], adapterProp) || resourceName
    );
  }
  return resourceName;
};

const getMapping = () => (
  isAdapter
    ? get(['mapping', 'fields'], getComponentContextProp(contextId.rootContextId, boundResource, contextId, true))
    : null
);

const getAdapterFields = () => {
  if (isAdapter) {
    const adapterProp = getComponentContextProp(contextId.rootContextId, boundResource, contextId, true);
    return ['identifier', 'authConfig', 'additionalInputs'].reduce((adapterFields, field) => {
      const value = get(['mapping', field], adapterProp) || get([field], adapterProp);
      return value ? { ...adapterFields, [field]: value } : adapterFields;
    }, {});
  }
  return {};
};

// TODO: should be handled in odata driver in a future version of
// api-configurator using string schema format field set to "uuid"
const uuidMatcher = /^[0-9a-f]{8}-[0-9a-f]{4}-[1-5][0-9a-f]{3}-[89ab][0-9a-f]{3}-[0-9a-f]{12}$/i;
const fixIdentifierValue = (value) => (value && typeof value === 'string' && !uuidMatcher.test(value) ? `'${value}'` : value);
const prepareQuery = (query, resourceType) => {
  if (resourceType === 'odata' && query.identifier && Object.keys(query.identifier).length > 1) {
    return { ...query, identifier: Object.keys(query.identifier).reduce((acc, key) => ({ ...acc, [key]: fixIdentifierValue(query.identifier[key]) }), {}) };
  }
  return query;
};

const mappingFields = getMapping(resourceName);
const isMappedAdapter = isAdapter && !!mappingFields;

async function makeRequest() {
  const resourceConfig = { ...getResourceConfig(getActualResourceName(resourceName)) };
  const { driverConfiguration = {} } = resourceConfig;
  const resourceType = resourceConfig.type || driverConfiguration.type;

  if (!resourceConfig) {
    throw new Error(`Couldn't find data resource with given name: ${resourceName}.`);
  }

  // Load a local data resource
  if (resourceType === 'local') {
    const { appId } = await supersonic.api.app.getAppId();
    const key = `local-resource:${appId}:${resourceName}:${id}`;
    const { data: record } = await supersonic.api.asyncStorage.getItem({ key });
    if (record != null && typeof record === 'object' && typeof record.id !== 'undefined') {
      return record;
    }
    throw new Error(`Record ${resourceName} with ID ${id} not found`);
  }
  if (resourceType === 'agdb') {
    const data = await supersonic.resource.find(resourceConfig.agdb_id, id, {});
    return data && data.value && data.value.object;
  }
  const parseBtpDestinationName = () => {
    if (!driverConfiguration.base || !driverConfiguration.base.baseURL) return undefined;
    const { baseURL } = driverConfiguration.base;
    if (baseURL.source !== 'expression') return undefined;
    const match = baseURL.key.formula.match(/connectedSystem\.btp\.applicationBaseUrl \+ '(.+)'/);
    if (!match) return undefined;
    return match[1];
  };
  const btpDestinationName = parseBtpDestinationName();
  if (supersonic.api.data.drivers && resourceType in supersonic.api.data.drivers) {
    const driver = supersonic.api.data.drivers[resourceType];
    if (!driver.execute) {
      throw new Error(`Invalid or missing driver for Resource ${resourceName}`);
    }
    let { authConfig } = request;
    if (resourceType === 'firestore') {
      try {
        const { firebase } = supersonic.api;
        const currentUser = await new Promise((resolve, reject) => {
          const unsubscribe = firebase.auth().onAuthStateChanged((user) => {
            unsubscribe();
            resolve(user);
          }, reject);
        });
        const token = await currentUser.getIdToken();
        authConfig = {
          type: 'bearer',
          authToken: token,
        };
      } catch (err) {
        /* ignore error and attempt query anyway */
      }
    } else if (resourceType === 'restd' && btpDestinationName) {
      try {
        const { sapBtp } = supersonic.api;
        const token = await sapBtp.getAccessToken();
        authConfig = {
          type: 'bearer',
          authToken: token,
        };
        const btpBaseURL = await sapBtp.resolveDestinationUrl(btpDestinationName);
        resourceConfig.driverConfiguration = {
          ...resourceConfig.driverConfiguration,
          base: {
            ...resourceConfig.driverConfiguration.base,
            baseURL: {
              source: 'str',
              key: btpBaseURL,
            },
          },
        };
      } catch (err) {
        /* ignore error and attempt query anyway */
      }
    }
    const agQuery = prepareQuery({
      resource: resourceConfig,
      operation: 'retrieve',
      authConfig,
      ...request,
      ...getAdapterFields(),
    }, resourceType);
    const response = await driver.execute(agQuery);
    if (!response || response.message) {
      if (resourceType === 'firestore') {
        let code; let message; let status;
        try {
          ({ code, message, status } = response.driverRawError.response.data.error);
        } catch (e) {
          message = response.message;
        }
        // eslint-disable-next-line no-throw-literal
        throw {
          type: 'firestore',
          code,
          message,
          status,
        };
      }
      throw new Error(response ? response.message : 'Request failed');
    }
    const record = response.record || response.data || null;
    return record;
  }
  // Load a "REST" data resource
  const operation = resourceConfig.operations.retrieve;
  if (!operation) {
    throw new Error(`Resource ${resourceName} does not support getting a single record`);
  }
  const requestParameters = [
    ...resourceConfig.parameters,
    ...operation.parameters,
  ];
  const headers = {};
  const queryComponents = [];
  let url = `${resourceConfig.base_url}${operation.relative_path || ''}`;
  const adapterFields = getAdapterFields();
  requestParameters.forEach((parameter) => {
    let value = !isAdapter ? parameters[parameter.id]
      : (get(['identifier', parameter.placement_key], request) || get(['additionalInputs', parameter.id], adapterFields));
    if (parameter.is_static || typeof value === 'undefined') {
      value = parameter.default;
    }
    if (value == null) {
    // No value for this parameter
      if (parameter.is_optional) {
        return;
      }
      throw new Error(`Missing required parameter ${JSON.stringify(parameter.title)}`);
    }
    // Map the parameter to headers/URL/query
    const { placement } = parameter;
    const placementKey = parameter.placement_key;
    if (placement === 'header') {
      // Add to headers
      headers[placementKey] = value;
    } else if (placement === 'query') {
      // Add to the URL as a query parameter
      queryComponents.push(`${encodeURIComponent(placementKey)}=${encodeURIComponent(String(value))}`);
    } else if (placement === 'path') {
      // Replace the placeholder in the URL with escaped string
      url = url.replace(new RegExp(`{\\s*${placementKey}\\s*}`, 'g'), encodeURIComponent(String(value)));
    } else if (placement === 'url') {
      // Replace the placeholder in the URL with unescaped string
      url = url.replace(new RegExp(`{\\s*${placementKey}\\s*}`, 'g'), String(value));
    }
  });
  // Add any query parameters to the URL
  if (queryComponents.length) {
    const newQuery = queryComponents.join('&');
    url = url.replace(/(?:\?(.*))?$/, (_, query) => (query ? `?${query}&${newQuery}` : `?${newQuery}`));
  }
  // Perform the request
  const response = await fetch(url, { method: 'GET', headers });
  if (!response.ok) {
    throw response;
  }
  let result = await response.json();
  const resultPath = operation.response_key_path ? operation.response_key_path.split('.') : [];
  while (result != null && resultPath.length) {
    result = result[resultPath.shift()];
  }
  if (!result) {
    throw new Error(`A ${resourceName} record not found from the response!`);
  }
  return result;
}

try {
  const record = await makeRequest();
  if (Array.isArray(record)) {
    const errorStr = 'The server responded with a list for a single data record. The response must be an object.';
    return [1, {
      error: {
        code: 'responseMustBeObject',
        status: -1,
        message: errorStr,
        rawError: new Error(errorStr),
      },
    }];
  }

  return [0, { record: !isMappedAdapter ? record : importRecord(record, mappingFields) }];
} catch (error) {
  // eslint-disable-next-line no-console
  // console.warn(error);
  if (error.type === 'firestore') {
    return [1, {
      error: {
        code: 'requestFailed',
        status: error.code,
        message: `${error.status}: ${error.message}`,
      },
    }];
  }

  let errorStr = String(error);

  if (errorStr.startsWith('Error: Couldn\'t find data resource')) {
    return [1, {
      error: {
        code: 'resourceNotFound',
        status: 404,
        message: errorStr,
        rawError: error,
      },
    }];
  }
  if (errorStr === 'TypeError: Failed to fetch') {
    errorStr += '. Does the server allow CORS?';
    return [1, {
      error: {
        code: 'requestFailed',
        status: error.status,
        message: errorStr,
        rawError: error,
      },
    }];
  } if (!error.json) {
    return [1, {
      error: {
        code: 'unknown',
        status: -1,
        message: errorStr,
        rawError: error,
      },
    }];
  }
  let rawError;
  try {
    const body = await error.json();
    rawError = body;
    errorStr = `JSON error response from server: ${JSON.stringify(body)}.`;
  } catch {
    errorStr = 'Non-JSON error body.';
    rawError = { message: errorStr };
  } finally {
    // eslint-disable-next-line no-unsafe-finally
    return [1, {
      error: {
        code: 'serverError',
        status: error.status,
        message: errorStr,
        rawError,
      },
    }];
  }
}

const { request, contextId, supersonic } = inputs;
const { resourceName, properties = {}, parameters = {} } = request;

const { getComponentContextProp } = supersonic.context;
const { getResourceConfig } = supersonic.api.data;
const { prepareExecutable } = supersonic.api.formulas || {};

const get = (p, o) => {
  const isNumber = (v) => typeof v === 'number';
  const isBoolean = (v) => typeof v === 'boolean';
  const isNull = (v) => v === null;
  const isString = (v) => typeof v === 'string';
  return p.reduce((xs, x) => (
    xs && (xs[x] || isNumber(xs[x]) || isBoolean(xs[x]) || isNull(xs[x]) || isString(xs[x])) ? xs[x] : undefined
  ), o);
};

const importRecord = (record, mappingFields = []) => {
  const importedData = {};
  mappingFields.forEach((field) => {
    if (field && field.mappingExpression && prepareExecutable) {
      try {
        const expression = prepareExecutable(JSON.parse(field.mappingExpression));
        importedData[field.propertyName] = expression.execute({ source: { record } });
      } catch (error) {
        throw new Error('An error occured while executing mapping formula.');
      }
    } else if (field && field.mapping && Array.isArray(field.mapping)) {
      const value = get(field.mapping, record);
      if (value !== undefined) {
        importedData[field.propertyName] = value;
      }
    }
  });
  return importedData;
};

const setNestedProp = (obj = {}, [first, ...rest], value) => ({
  ...obj,
  [first]: rest.length
    ? setNestedProp(obj[first], rest, value)
    : value,
});

const exportRecord = (record, mappingFields = []) => {
  let exportedRecord = {};
  mappingFields.forEach((field) => {
    if (field && field.mapping && Array.isArray(field.mapping)) {
      exportedRecord = setNestedProp(exportedRecord, field.mapping, get([field.propertyName], record));
    }
  });
  return exportedRecord;
};

const exportResourceConfig = (resourceConfig, mappingFields) => {
  const exportedResourceConfig = { ...resourceConfig };
  if (resourceConfig.record) {
    exportedResourceConfig.record = exportRecord(resourceConfig.record, mappingFields);
  }
  return exportedResourceConfig;
};

const adapterPrefix = 'adapter';
const [prefix, boundResource] = (resourceName || '').split(':');
const isAdapter = prefix === adapterPrefix;

const getActualResourceName = () => {
  if (isAdapter) {
    const adapterProp = getComponentContextProp(contextId.rootContextId, boundResource, contextId, true);
    return (
      get(['mapping', 'value'], adapterProp) || get(['value'], adapterProp) || resourceName
    );
  }
  return resourceName;
};

const getMapping = () => (
  isAdapter
    ? get(['mapping', 'fields'], getComponentContextProp(contextId.rootContextId, boundResource, contextId, true))
    : null
);

const getAdapterFields = () => {
  if (isAdapter) {
    const adapterProp = getComponentContextProp(contextId.rootContextId, boundResource, contextId, true);
    return ['authConfig', 'additionalInputs'].reduce((adapterFields, field) => {
      const value = get(['mapping', field], adapterProp) || get([field], adapterProp);
      return value ? { ...adapterFields, [field]: value } : adapterFields;
    }, {});
  }
  return {};
};

const mappingFields = getMapping(resourceName);
const isMappedAdapter = isAdapter && !!mappingFields;

async function makeRequest() {
  const resourceConfig = { ...getResourceConfig(getActualResourceName(resourceName)) };
  const { driverConfiguration = {} } = resourceConfig;
  const resourceType = resourceConfig.type || driverConfiguration.type;

  if (!resourceConfig) {
    throw new Error(`Couldn't find data resource with given name: ${resourceName}.`);
  }

  // Create a local data resource
  if (resourceType === 'local') {
    const { id } = properties;
    if (id == null) {
      throw new Error(`Missing ${resourceName} record ID`);
    }
    const { appId } = await supersonic.api.app.getAppId();
    const key = `local-resource:${appId}:${resourceName}:${id}`;
    const { data: record } = await supersonic.api.asyncStorage.getItem({ key });
    if (record != null && typeof record === 'object' && typeof record.id !== 'undefined') {
      throw new Error(`Record ${resourceName} with ID ${id} already exists`);
    }
    await supersonic.api.asyncStorage.setItem({
      key, data: !isMappedAdapter ? properties : exportRecord(request.record, mappingFields),
    });
    return properties;
  }
  // Create an AGDB data resource
  if (resourceType === 'agdb') {
    const data = await supersonic.resource.create(resourceConfig.agdb_id, { object: properties });
    return data && data.value && data.value.object;
  }
  const parseBtpDestinationName = () => {
    if (!driverConfiguration.base || !driverConfiguration.base.baseURL) return undefined;
    const { baseURL } = driverConfiguration.base;
    if (baseURL.source !== 'expression') return undefined;
    const match = baseURL.key.formula.match(/connectedSystem\.btp\.applicationBaseUrl \+ '(.+)'/);
    if (!match) return undefined;
    return match[1];
  };
  const btpDestinationName = parseBtpDestinationName();
  if (supersonic.api.data.drivers && resourceType in supersonic.api.data.drivers) {
    const driver = supersonic.api.data.drivers[resourceType];
    if (!driver.execute) {
      throw new Error(`Invalid or missing driver for Resource ${resourceName}`);
    }
    let { authConfig } = request;
    if (resourceType === 'firestore') {
      try {
        const { firebase } = supersonic.api;
        const currentUser = await new Promise((resolve, reject) => {
          const unsubscribe = firebase.auth().onAuthStateChanged((user) => {
            unsubscribe();
            resolve(user);
          }, reject);
        });
        const token = await currentUser.getIdToken();
        authConfig = {
          type: 'bearer',
          authToken: token,
        };
      } catch (err) {
        /* ignore error and attempt query anyway */
      }
    } else if (resourceType === 'restd' && btpDestinationName) {
      try {
        const { sapBtp } = supersonic.api;
        const token = await sapBtp.getAccessToken();
        authConfig = {
          type: 'bearer',
          authToken: token,
        };
        const btpBaseURL = await sapBtp.resolveDestinationUrl(btpDestinationName);
        resourceConfig.driverConfiguration = {
          ...resourceConfig.driverConfiguration,
          base: {
            ...resourceConfig.driverConfiguration.base,
            baseURL: {
              source: 'str',
              key: btpBaseURL,
            },
          },
        };
      } catch (err) {
        /* ignore error and attempt query anyway */
      }
    }
    let agQuery = {
      resource: resourceConfig,
      operation: 'create',
      authConfig,
      ...request,
      ...getAdapterFields(),
    };
    if (isMappedAdapter) {
      agQuery = exportResourceConfig(agQuery, mappingFields);
    }
    const response = await driver.execute(agQuery);
    if (!response || response.message) {
      if (resourceType === 'firestore') {
        let code; let message; let status;
        try {
          ({ code, message, status } = response.driverRawError.response.data.error);
        } catch (e) {
          message = response.message;
        }
        // eslint-disable-next-line no-throw-literal
        throw {
          type: 'firestore',
          code,
          message,
          status,
        };
      }
      throw new Error(response ? response.message : 'Request failed');
    }
    const record = response.record || response.data || null;
    return record;
  }
  // Create a "REST" data resource
  const operation = resourceConfig.operations.create;
  if (!operation) {
    throw new Error(`Resource ${resourceName} does not support creating new records`);
  }
  const requestParameters = [
    ...resourceConfig.parameters,
    ...operation.parameters,
  ];
  const requestSchema = operation.request_schema;
  const isEmptyResponse = !properties || (requestSchema != null && requestSchema.type === 'undefined');
  const headers = isEmptyResponse ? {} : { 'Content-Type': 'application/json' };
  const body = isEmptyResponse ? undefined
    : JSON.stringify(!isMappedAdapter ? properties : exportRecord(request.record, mappingFields));
  const queryComponents = [];
  let url = `${resourceConfig.base_url}${operation.relative_path || ''}`;
  const adapterFields = getAdapterFields();
  requestParameters.forEach((parameter) => {
    let value = !isAdapter ? parameters[parameter.id]
      : get(['additionalInputs', parameter.id], adapterFields);
    if (parameter.is_static || typeof value === 'undefined') {
      value = parameter.default;
    }
    if (value == null) {
    // No value for this parameter
      if (parameter.is_optional) {
        return;
      }
      throw new Error(`Missing required parameter ${JSON.stringify(parameter.title)}`);
    }
    // Map the parameter to headers/URL/query
    const { placement } = parameter;
    const placementKey = parameter.placement_key;
    if (placement === 'header') {
      // Add to headers
      headers[placementKey] = value;
    } else if (placement === 'query') {
      // Add to the URL as a query parameter
      queryComponents.push(`${encodeURIComponent(placementKey)}=${encodeURIComponent(String(value))}`);
    } else if (placement === 'path') {
      // Replace the placeholder in the URL with escaped string
      url = url.replace(new RegExp(`{\\s*${placementKey}\\s*}`, 'g'), encodeURIComponent(String(value)));
    } else if (placement === 'url') {
      // Replace the placeholder in the URL with unescaped string
      url = url.replace(new RegExp(`{\\s*${placementKey}\\s*}`, 'g'), String(value));
    }
  });
  // Add any query parameters to the URL
  if (queryComponents.length) {
    const newQuery = queryComponents.join('&');
    url = url.replace(/(?:\?(.*))?$/, (_, query) => (query ? `?${query}&${newQuery}` : `?${newQuery}`));
  }
  // Perform the request
  const response = await fetch(url, { method: 'POST', headers, body });
  if (!response.ok) {
    throw response;
  }
  let result;
  try {
    result = await response.json();
  } catch (e) {
    result = null;
  }
  const resultPath = operation.response_key_path ? operation.response_key_path.split('.') : [];
  while (result != null && resultPath.length) {
    result = result[resultPath.shift()];
  }
  return result;
}

try {
  const response = await makeRequest();
  return [0, { response: !isMappedAdapter ? response : importRecord(response, mappingFields) }];
} catch (error) {
  // eslint-disable-next-line no-console
  // console.warn(error);
  if (error.type === 'firestore') {
    return [1, {
      error: {
        code: 'requestFailed',
        status: error.code,
        message: `${error.status}: ${error.message}`,
      },
    }];
  }

  let errorStr = String(error);

  if (errorStr.startsWith('Error: Couldn\'t find data resource')) {
    return [1, {
      error: {
        code: 'resourceNotFound',
        status: 404,
        message: errorStr,
        rawError: error,
      },
    }];
  }

  if (errorStr === 'TypeError: Failed to fetch') {
    errorStr += '. Does the server allow CORS?';
    return [1, {
      error: {
        code: 'requestFailed',
        status: error.status,
        message: errorStr,
        rawError: error,
      },
    }];
